import { NavLink } from "react-router-dom";
import "./Header.css";
import Logo from "../Ui/Icons/Logo";
import FlagUS from "../Ui/Icons/FlagUS";
import SelectSvg from "../Ui/Icons/SelectSvg";
// import NavItem from "../../assets/navItem.svg";
import { useEffect, useState } from "react";
import CloseIcon from "../Ui/Icons/CloseIcon";
import NavMenuIcon from "../Ui/Icons/NavMenuIcon";

const Header = () => {
  const [active, setActive] = useState(false);

  const clickHandler = () => {
    setActive(!active);
  };

  useEffect(()=>{
    if(active){
      document.body
    }
  },[active])

  return (
    <header className="home_page_header">
      <div className="container">
        <Logo />
        <nav>
          {!active ? <NavMenuIcon onClick={clickHandler} /> : ""}
          <ul className={`header_nav_ul ${active ? "active" : ""}`}>
            {active ? <CloseIcon onClick={clickHandler} /> : ""}

            <li>
              <NavLink to={"/"}>Home</NavLink>
            </li>
            <li>
              <NavLink to={"/"}>
                Auction <SelectSvg />
              </NavLink>
            </li>
            <li>
              <NavLink to={"/"}>Log In</NavLink>
            </li>
            <li>
              <NavLink to={"/"}>Register</NavLink>
            </li>
            <li>
              <NavLink to={"/"}>
                <FlagUS />
                Eng
                <SelectSvg />
              </NavLink>
            </li>
            <li>
              <NavLink to={"/"}>
                <time>05:07</time>
                <SelectSvg />
              </NavLink>
            </li>
            <li>
              <NavLink to={"/"}>Contac Us</NavLink>
            </li>
          </ul>
        </nav>
      </div>
    </header>
  );
};

export default Header;
